import React from 'react'
import { MapContainer, TileLayer, useMap, Popup } from 'react-leaflet'
import { Marker, Circle } from 'react-leaflet';
import 'leaflet/dist/leaflet.css';
import L from 'leaflet';

function setupMarkerIcon() {
    delete L.Icon.Default.prototype._getIconUrl;
    L.Icon.Default.prototype._getIconUrl = function (name) {
        return L.Icon.Default.imagePath + '/' + name + '.png';
    };
}


export default function Map() {
    setupMarkerIcon();
    const center = [33.6411, -117.8425]; // UCI Coordinates
    const position = [51.505, -0.09]
    return (
        <div>
            <MapContainer center={position} zoom={13} scrollWheelZoom={false}>
                <TileLayer
                    attribution='&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors'
                    url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
                />
                <Marker position={position}>
                    <Popup>
                        A pretty CSS3 popup. <br /> Easily customizable.
                    </Popup>
                </Marker>
            </MapContainer>,
        </div>
    )
}
